import React from 'react';

const StartPage = ({onNavigate}) => {
    const handleBackToHome = () => {
        onNavigate('home');
    };

    return (
        <div>
            <p>Hello! This is the start page</p>
            <button onClick={handleBackToHome} className="back-button"> Back to Select Skills </button>
        </div>
    );
}

export default StartPage;
